(55839, 94079, 0, 1, '沒有不可能', '我相信每個人都可創造自己的奇蹟 或許有的時候 我們的奇蹟不過是其他人垂手可得的 但那就是我們對自己的承諾與成就… \r\n\r\n人生是這樣 一旦設定了目標 就要朝著目標走 慢或快有時候不是我們可以決定的 但是我們可以一直努力與堅持下去 會做到的--只要我們不放棄\r\n\r\n技巧層面:\r\n歌曲用Smooth的前奏帶出早晨清新的感覺 新的一天\r\n第一遍時歌曲在C大調 第二遍副歌後 第三遍副歌在D大調 第四遍副歌在E大調 最後一句沒有不可能在F大調    利用轉Key帶出高升的感覺', '2012-11-11 00:00:00', 2000, 5, 0, 4, '是一個美麗清新的早晨\r\n陽光灑滿大地的每一個角落\r\n我滿胸的熱情 奔騰\r\n掌握當下每一刻的永恆\r\n年輕在我 有勇氣追逐你們說的不可能\r\n放手一博 讓世界記錄我的認真\r\n努力往前衝 不遲疑 不退縮 抓住我的機會\r\n我們一起創造令人感動的時分\r\n世界 請為我們喝采 為我們勇敢挑戰的心給一個掌聲\r\nOh!!! 堅定自信的眼神 超越極限 我們想做的事\r\n沒有不可能!\r\n年輕在我 有勇氣追逐你們說的不可能\r\n放手一博 讓世界記錄我的認真\r\n努力往前衝 不遲疑 不退縮 抓住我的機會\r\n我們一起創造 令人感動的時分\r\n世界 請為我們喝采 為我們勇敢挑戰的心給一個掌聲\r\nOh(Yeah)!!! 堅定自信的眼神 超越極限 \r\n我們想(要)做的事 我們不放棄的事\r\n沒有不可能!', '', 205, '', '平威', 'Pingway Bian', 'Pingway Bian', '', '', 0, 1, 0, '2012-11-11 19:29:23', '2015-03-12 13:56:45', '0000-00-00 00:00:00'),
