(55841, 145592, 0, 1, 'After cloudy (Demo)', '長大後發現曾經追求的夢\r\n慢慢的被現實的那塊雲朵遮住了\r\n漸漸的打擊著曾經許下的誓言\r\n倔強的我們還是堅信著\r\n那朦朧的畫面會在雲散開之後而清晰', '2012-11-11 00:00:00', 2000, 0, 1, 7, 'When I close to the real world\r\nit pushing and pulling me down\r\nAll the pains are all around I can feel\r\nthe pressure inside me\r\n \r\n想撥開雲朵\r\n飛行那個夢\r\n綑綁的現實中\r\n畫不出那彩虹\r\n \r\n星星在閃爍\r\n消逝那個夢\r\n放棄過的面容\r\n需要一秒的自由\r\n \r\n凝望著聚光燈閃爍 握緊不住我的天空\r\n黑色的雲朵飄著 是否忘了那份笑容\r\n遺忘了找尋著曾經 擁抱過的那份感動\r\n轉動 轉動 找回最初那個夢', '', 315, '', '', '', '', '', '', 0, 1, 0, '2012-11-11 20:54:32', '2015-03-12 13:56:45', '0000-00-00 00:00:00'),
