(55844, 92574, 5328, 11, '蘆葦枯乾', '作曲：奧利佛\r\n作詞：余皓文\r\n編曲：飢餓藝術家\r\n主唱／吉他／貝斯／合成器：奧利佛\r\n鍵盤：張瀚中\r\n鼓組：張浩嘉\r\n錄音：奧利佛@大小眼錄音室／錢煒安@112F Recording Studio\r\n混音：鄧世傑@Red Sound Recording Studio\r\n母帶混音：鄭皓文@G5 Studio', '2012-11-26 00:00:00', 2012, 19, 0, 7, '把我見的都放在鏡子窗邊  要讓我們記得  天邊的角落\r\n可以見的都不似是已經相識  卻像你們已遠走  心即將降落\r\n\r\n到處探索著渴望‭  ‬別讓蘆葦枯乾‭  ‬再次枯乾\r\n愛‭  ‬再跌盪\r\n連脈搏‭  ‬就地埋藏\r\n\r\n將我聽的都拋到海深中央  再願我能夠放開  所有的寄望\r\n天已變色‭  ‬身心再無刺激交迫  意就快在頃刻‭  ‬失卻得救助\r\n\r\n到處探索著渴望‭  ‬別讓蘆葦枯乾‭  ‬再次枯乾\r\n愛‭  ‬再跌盪\r\n連脈搏‭  ‬就地埋藏\r\n愛‭  ‬再跌盪\r\n無自覺‭  ‬抹去心窩‭ \r\n‬\r\neveryday every minute\r\nevery night I cannot see you breathe\r\n\r\n愛‭  ‬再跌盪\r\n連脈搏‭  ‬就地埋藏\r\n愛‭  ‬再跌盪\r\n無自覺‭  ‬抹去心窩‭ \r\n\r\n‬everyday every minute\r\nevery night I cannot see you\r\neveryday every minute\r\nevery night I cannot see you breathe', '', 260, '', '奧利佛', '余皓文', '奧利佛', '黑市音樂', '', 1, 1, 0, '2012-11-12 06:09:30', '2015-03-12 13:56:45', '0000-00-00 00:00:00'),
