(55848, 396, 5193, 1, '不被瞭解的怪人', '', '2012-11-14 00:00:00', 2000, 20, 0, 5, '', '置身人群中 你只需要被淹沒 享受 沉默\n退到人群後 你只需給予雙手 微笑 等候\n\n不被瞭解的怪人 只能看見熾熱的閃爍 所在的 所抱的 都是人工\n不被瞭解的怪人 只能聽見自己的語言 所想的 所抓的 都將破滅\n\n置身人群中 你只需要被淹沒 享受 沉默\n退到人群後 你只需給予雙手 微笑 等候\n\n不被瞭解的怪人 只能看見熾熱的閃爍 所在的 所抱的 都是人工\n不被瞭解的怪人 只能聽見自己的語言 所想的 所抓的 都將破滅\n\n就這樣恣意的活著 自顧自地說著 你們他們也一併地說了\n對什麼事都飢渴 那些我還弄不懂的都一併吞了 對什麼事都感到飢餓\n\n不被瞭解的怪人 只能看見熾熱的閃爍 所在的 所抱的 都是人工\n不被瞭解的怪人 只能聽見自己的語言 所想的 所抓的 都將破滅', 212, '', '', '', '', '', '', 0, 1, 0, '2012-11-12 15:06:15', '2015-03-12 13:56:45', '0000-00-00 00:00:00'),
(55849, 396, 5193, 2, '地球沒有家', '', '2012-11-14 00:00:00', 2000, 20, 0, 5, '', '他的最愛被弄髒 他的夢想被踐踏 他的無邪被淡化\n他的感慨被放大 他的慌張被看穿 他的反抗被壓下\n\n惡性會循環 那又怎樣 沒人要管 就沒人管\n良心會不安 那又怎樣 身邊的人啊 都閉起嘴巴\n\n地球沒有家 花園沒有花 誰還能保障 最純的心臟\n他不想長大 別讓他長大 悖德的景象 虛偽的盛裝\n\n他的最愛被弄髒 他的夢想被踐踏 他的無邪被淡化\n他的感慨被放大 他的慌張被看穿 他的反抗被壓下\n\n惡性會循環 那又怎樣 沒人要管 就沒人管\n良心會不安 那又怎樣 身邊的人啊 都閉起嘴巴\n\n地球沒有家 花園沒有花 誰還能保障 最純的心臟\n他不想長大 別讓他長大 悖德的景象 虛偽的盛裝\n\n地球沒有家 花園沒有花 誰還能保障 最純的心臟\n他不想長大 別讓他長大 悖德的景象 虛偽的盛裝\n\n他的黑暗是黑暗 他的悲傷很悲傷 他的渴望多渴望', 164, '', '', '', '', '', '', 0, 1, 0, '2012-11-12 15:10:23', '2015-03-12 13:56:45', '0000-00-00 00:00:00'),
(55850, 396, 5193, 3, '東京下雨了', '', '2012-11-14 00:00:00', 2000, 20, 0, 5, '', '嘿好久不見 我總想起差一點的那場冒險\n畫好的路線 輕狂年少壯遊志願沒有實現\n\n說要一起結伴 可又不夠自然\n就像一部熱映長片 過了就容易忘\n\n你最愛的東京下雨了 你嚮往的巴黎下雨了\n活在憂傷世界的我們 要如何變得更快樂\n\n你活著的從前下雨了 你等待的未來下雨了\n沒有幸運眷顧的我們 如果能在一起就好了\n\n青春的氣味 無畏無懼擴散得那麼明顯\n誰能將甜美 原封不動蒐藏得那麼完全\n\n落下一顆雨點 點成巨大思念\n在你消失瞬間 宇宙暈炫地轉天旋\n\n你最愛的東京下雨了 你嚮往的巴黎下雨了\n活在憂傷世界的我們 要如何變得更快樂\n\n你活著的從前下雨了 你等待的未來下雨了\n沒有幸運眷顧的我們 如果能在一起就好了\n\n你最愛的東京下雨了 你嚮往的巴黎下雨了\n活在憂傷世界的我們 要如何變得更快樂\n\n你活著的從前下雨了 你等待的未來下雨了\n沒有幸運眷顧的我們 如果能在一起就好了', 244, '', '', '', '', '', '', 0, 1, 0, '2012-11-12 15:15:36', '2015-03-12 13:56:45', '0000-00-00 00:00:00'),
