(55852, 396, 5193, 5, 'WHYWHYWHY', '', '2012-11-14 00:00:00', 2000, 20, 0, 5, '', '這世界充滿虛偽 是誰在笑容滿面 是誰又愁眉苦臉\n只要你有錢有權 規則就能被改變 充滿噁心的世界\n \n看得見‭ 看不見‭ 善用直覺 閉上你的嘴‭ (你哪位)‭ 吃大便\n\nWHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY\nWHY WHY WHY WHY WHY WHY WHY WHY\nWHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY\nWHY WHY WHY WHY WHY WHY WHY WHY\n歡迎到錢的世界\nWHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY\nWHY WHY WHY WHY WHY WHY WHY WHY\n\n歡迎到變態社會  課本裡教你是非 長大後不再絕對\n有錢的就是大爺  電視裡都有上演 真實可惡的世界\n\n閉上眼 張開眼 扭曲的臉 我會用生命 (去捍衛)‭每一天‬\n\nWHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY\nWHY WHY WHY WHY WHY WHY WHY WHY\nWHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY\nWHY WHY WHY WHY WHY WHY WHY WHY\n歡迎到錢的世界\nWHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY\nWHY WHY WHY WHY WHY WHY WHY WHY\n\nWHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY\nWHY WHY WHY WHY WHY WHY WHY WHY\nWHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY\nWHY WHY WHY WHY WHY WHY WHY WHY\n歡迎到錢的世界\nWHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY WHY\nWHY WHY WHY WHY WHY WHY WHY WHY\n歪歪', 162, '', '', '', '', '', '', 0, 1, 0, '2012-11-12 15:24:49', '2015-03-12 13:56:45', '0000-00-00 00:00:00'),
