(55857, 396, 5193, 10, '擁有', '', '2012-11-14 00:00:00', 2000, 20, 0, 5, '', '等待等成了我的老地方 靠近這裡像是靠近悲傷\n總說要放 找不到哭的地方 想著你的我 比夜還淒涼\n\n沒說完的話還掛在嘴上 怎麼選擇生活的步伐\n心的成長 伴隨著他人眼光 怎麼能灌溉 怎能分享？\n\n我擁有一朵美麗的花 在心上 躺在綠草地看鳥兒在飛翔\n你擁有一顆耀眼太陽 在心上 滋養大地 逃喧囂的骯髒\n\n在荒涼山丘種一株希望 也並不是真要開出希望\n若有期盼 較容易忘掉憂傷 可是憂傷啊 早就已曝光\n\n擁抱孕育出無限的力量 靠近黑暗像是靠近晴朗\n隱形翅膀 畏懼著他人眼光 怎麼能飛翔 怎能發光？\n\n我擁有一朵美麗的花 在心上 躺在綠草地看鳥兒在飛翔\n你擁有一顆耀眼太陽 在心上 滋養大地 逃喧囂的骯髒\n\n我擁有一朵美麗的花 在心上 躺在綠草地看鳥兒在飛翔\n你擁有一顆耀眼太陽 在心上 滋養大地 逃喧囂的骯髒\n', 179, '', '', '', '', '', '', 0, 1, 0, '2012-11-12 15:46:23', '2015-03-12 13:56:45', '0000-00-00 00:00:00'),
