(55872, 143583, 0, 1, '超音速飛行', '', '2012-09-06 00:00:00', 2000, 0, 1, 14, 'I''m sorry 感應不到你的頻率\nIt''s not funny 你說得那些話題\n靠得太近 卻什麼都看不清\n一不小心 我好像又變成你\n\n所以我戴上耳機 在超音速裡飛行\n\n戴上墨鏡 在人潮享受安靜\n不需要新衣 我就是新的自己\n很多人的公寓 很多一人份的傢俱\n我住在屋頂 能看更遠的風景\n\n臉上沒有表情 卻搖了又滾在心裡\n我唯一能夠做的事 就是超越音速飛行\n\n這樣的你最美麗\n太多的規距搞得烏煙瘴氣\n這樣的你最美麗\n我拉開距離其實是為了...\n\n什麼原因 要抗拒地心引力\n快不能呼吸 才看見真正的你\n我把全部那麼清楚的我全都給你\n不要懷疑 快摧毀那道牆壁\n\n臉上沒有表情 卻搖了又滾在心裡\n我唯一能夠做的事就是超越音速飛行\n\n這樣的你最美麗\n太多的規距搞得烏煙瘴氣\n這樣的你最美麗\n我拉開距離其實是為了 和你更近', '', 242, '', '陳信宏', '陳信宏', 'Overtone', 'Overtone', '', 1, 1, 0, '2012-11-12 17:12:19', '2015-03-12 13:56:46', '0000-00-00 00:00:00'),
