(55881, 3461, 5229, 1, '無感官之舞', '', '2012-11-24 00:00:00', 2012, 0, 1, 1, '入夜後他牽起他的手，眼中的光火漸跳漸遠；\n純淨耳朵栓牢的純淨聲音，仍虛化流失不止。\n\n翻老相冊一般，他們嗅著彼此的氣息和香味；\n一開一闔虛弱的唇，撕裂似地無奈怒吼：\n\n「我們跳舞，是的我們跳舞，我們都跳舞；\n在漆黑真空的世界裡，我們損耗，我們都損耗。」', '', 319, '', '陳誇張', '陳誇張', '陳誇張', '', '', 0, 1, 0, '2012-11-12 18:30:53', '2015-03-12 13:56:46', '0000-00-00 00:00:00'),
(55882, 3461, 5229, 2, '媽媽的魚', '', '2012-11-24 00:00:00', 2012, 0, 1, 1, '我想當一隻聰明的魚\n不管在多污濁的海域\n仍能向清澈的方向游去\n\n不管在多複雜的魚群\n也能乘懂得自己的洋流\n\n\n\n我想當一隻勇敢的魚\n不管多少危險和痛苦\n仍能讓笑容常掛在臉上\n\n不管多大衝擊和誤會\n也能開心堅定面對\n\n就算有天傷得起不來\n想起媽媽的話不再害怕', '', 256, '', '陳誇張', '陳誇張', '陳誇張', '', '', 0, 1, 0, '2012-11-12 18:31:27', '2015-03-12 13:56:46', '0000-00-00 00:00:00'),
(55883, 3461, 5229, 3, '生存遊戲', '', '2012-11-24 00:00:00', 2012, 0, 1, 1, '我孤軍奮戰，\r\n第一回合險些被群饑餓的小野獸困住；\r\n我靈巧地從牠們手中溜走，\r\n學到了閃躲逃避的道理。\r\n\r\n如果有天當你發現自己需要被救，\r\n在這城市生存遊戲裡，你就輸了，\r\n徹底地輸了。\r\n\r\n我繼續奮戰，\r\n在第二回合時被窮困的黑暗騎士鎖住；\r\n我記取教訓，\r\n在他靠近前先亮出自己的武裝。\r\n\r\n我帶上盔甲，層層裝備的我不再害怕。\r\n一個女孩從身邊走過，魔鬼跟著；\r\n我看著她一分分被侵蝕。因為我徹底學會...\r\n\r\n出局吧。離開吧。', '', 279, '', '陳誇張', '陳誇張', '陳誇張', '', '', 0, 1, 0, '2012-11-12 18:32:00', '2015-03-12 13:56:46', '0000-00-00 00:00:00'),
(55884, 3461, 5229, 4, '有多少人像我一樣', '', '2012-11-24 00:00:00', 2012, 0, 1, 1, '有多少人像我一樣在放縱裡苟延殘喘地活著\r\n\r\n我們只不過都怕 怕遠離了最近的回家的路 \r\n我們只不過擔心 擔心把自己丟進了最深的無底的壓迫\r\n\r\n最後呢 什麼都不做 結果呢 被這個流動湍急的生活 淹埋罷了\r\n\r\n有多少人像我一樣在放縱裡苟延殘喘地活著 不知道哪時候才醒來', '', 246, '', '陳誇張', '陳誇張', '陳誇張', '', '', 0, 1, 0, '2012-11-12 18:32:33', '2015-03-12 13:56:46', '0000-00-00 00:00:00'),
(55885, 3461, 5229, 5, '來去自如', '', '2012-11-24 00:00:00', 2012, 0, 1, 1, '你自一座荒島飄泊而來，闌珊地在熱鬧的漁港上了岸。\r\n\r\n一件溫暖的外衣，同時覆蓋著你漂浮不定的年輕靈魂，\r\n\r\n那段時光的那個國度、那片天空，你享受所有，\r\n而悲傷片刻快樂瞬間、急的時候，你總來去自如。\r\n\r\n你擁有的許多愛讓你來去自如。', '', 323, '', '陳誇張', '陳誇張', '陳誇張', '', '', 0, 1, 0, '2012-11-12 18:33:05', '2015-03-12 13:56:46', '0000-00-00 00:00:00'),
