(55896, 162564, 0, 1, '黑孔雀', '', '2012-11-13 00:00:00', 2000, 0, 1, 5, ' red 親吻誰的側臉\n不想成為百人斬中 的某位\nblue 眼角湛藍淚水\n只想笑著流淚卻又是哪位\nshit 將我的笑容摧毀\n\ngreen 我的青春外衣\n穿越少越沒人想了解 內心\ngold 那夜紙醉金迷\n一擲千金求那瞬間眼神迷離\n哪有這麼容易 不如讓我 \n背對世界而去 \n\nblack peafowl\n黑色絢爛不想被你眼光左右 (我就是我)\n我就是不同那些斑斕斑斕 (你看不透)\n鮮豔孔雀中我選擇做純粹的我 \n與眾不同\n\n\n(black)紫藍綠黃橙紅 (just black)剝落 看見我的脈搏', '', 214, '', '', '', '', '', '', 1, 1, 0, '2012-11-13 13:11:04', '2015-03-12 13:56:47', '0000-00-00 00:00:00'),
