(55900, 162564, 0, 1, '愛情朝九晚五', '', '2012-11-13 00:00:00', 2000, 0, 1, 5, '上網搜尋關鍵字 「你的真愛」\nI just try & try & try & try it\n點閱了新的同類 匯入期盼\nmy heart''s moving & moving & moving & moving\n\n受騙了醒了醉了多少年\n愛就是猜他的惑他的信他的諾言\n默背了新的習慣或改變\n愛就是不斷地不斷地心歡或心悲\n\n一而再 無話不成眠\n一而再 在他面前失去了防備\n一而再 理智脫了隊\n縱容我 太熱切 太撒野 白天黑夜 待在他身邊\n\n通往他心所在地點 always I know\n需要多少通勤時間 take me go there\n朝九晚五殷勤奉獻 come on let''s go \n享受那淪陷的感覺\n\n反應的時間還要再短些 \n一個眼神或表情就能馬上應變\n鍛鍊身心到能受任何考驗\n所有合理或不合理都微笑兌現\n\n愛情這樣運轉我去習慣 \n而他值不值得 預設不完\n而我已資深到能承擔 愛情相關的職業傷害\n理智卻仍然置身事外', '', 222, '', '', '', '', '', '', 1, 1, 0, '2012-11-13 13:19:39', '2015-03-12 13:56:47', '0000-00-00 00:00:00'),
(55901, 162341, 5220, 1, 'Main Title Theme', '', '2011-11-16 00:00:00', 2011, 20, 0, 2, '', '', 184, '', '', '', '', '', '', 0, 0, 0, '2012-11-13 13:19:57', '2015-03-12 13:56:47', '0000-00-00 00:00:00'),
(55902, 162564, 0, 1, '夢奇地', '', '2012-11-13 00:00:00', 2000, 0, 1, 5, '斑馬線 紅綠燈 柏油路 電線桿\n從小這就是這樣一切很自然   \n媽媽看著大馬路心裡很感慨\n說這裡曾是一片花海  (說這裡曾經存在)\n我接受這是生活便利的交換\n也只能周末旅行好好地安排\n洶湧的人海從城市裡冒出來\n假日在山上擠成一塊    或是在夢裡一睹為快\n\n重新 在心底  種下一片森林\n從眼神告訴我  那裏的平靜\n回憶深深地凋零\n成為豐沛的春泥\n坐上 蒲公英  童年夢的飛行\n嘴角上揚模仿  同樣的月形\n墜落滿天星海裡\n能否沉睡的黎明(在這裡)  不要醒\n\n說來說去還不是想只能歸想\n人要懂得滿足生活才能自在\n有天出門眼前竟然一片花海\n原來是對面新的看板  哎呀呀\n我接受這是時代進步的小遺憾\n也只好一路上眼神保持渙散\n洶湧的人海回到家電視打開\n美麗邂逅新的開發案    自然美景還在誰心坎\n', '', 255, '', '', '', '', '', '', 1, 1, 0, '2012-11-13 13:20:45', '2015-03-12 13:56:47', '0000-00-00 00:00:00'),
