(55987, 162614, 5240, 1, 'Moiré', '', '2012-11-14 00:00:00', 2012, 20, 0, 7, '夜晚的黑闇有如槲寄生\r\n當鐘聲響起向我們告知時候已到\r\n無言的身體以及無言的心臟\r\n當鐘聲響起向我們告知時候已到\r\n\r\n我不會伸手\r\n當你用你那雙腳\r\n踏出那一步時\r\n我只會在背後給你力量\r\n\r\n不需要回首\r\n不需要想起\r\n你只要好好活下去就好\r\n如舞動般地如歌唱般地\r\n是啊，我也能微笑著留下你\r\n能毫不猶豫地放開手\r\n今日的太陽和為了明天的夢想\r\n我倆抱著祝福\r\n\r\n傳達給\r\n門扉的另一邊\r\n\r\n忘了要眨眼\r\n心跳加速著\r\n今天確實活著呢\r\n如舞動般地如歌唱般地\r\n彷彿不斷流逝消失的泡沫般\r\n就算從是無知的誕生開始\r\n無知的結束也好\r\n這宏亮的聲音會傳達到哪裡呢\r\n是啊這首歌從現在開始進入高潮\r\n\r\n向著門扉的另一邊\r\n我想看見你的笑容\r\n就在這裡', '', 497, '', '', '', '', '', '', 1, 1, 0, '2012-11-13 16:21:06', '2015-03-12 13:56:50', '0000-00-00 00:00:00'),
(55988, 162614, 5240, 2, 'Harem', '', '2012-11-14 00:00:00', 2012, 20, 0, 7, '今天由我輕輕燦然一笑\r\n你今天也過得很充實呢\r\n我不覺得只有當時年輕的我們\r\n才是一種美\r\n\r\n來跳段舞吧\r\n\r\n絕不會描繪為了踐踏他人的理想圖\r\n絕不會加諸莫須有罪名\r\n多少非本願的約定\r\n從出生前就是謝謝你與謝你的雞婆\r\n\r\n來跳段舞吧\r\n\r\n在路邊枯萎的野花\r\n想必誰也不知道其名\r\n明天如果天氣晴想在外面碰個面\r\n今天我找到很好的去處喔\r\n\r\n在風中看到相同的野花\r\n我喜歡上了另一種角度\r\n是啊我和你雖然不同\r\n那又怎樣呢\r\n\r\n真是膽小啊\r\n真是怕寒啊\r\n真是貪心啊\r\n真是愛講話啊\r\n牽著狗兒\r\n前往海濱\r\n工作直到深夜\r\n跳舞直到早晨\r\n\r\n來跳段舞吧', '', 237, '', '', '', '', '', '', 1, 1, 0, '2012-11-13 16:22:08', '2015-03-12 13:56:50', '0000-00-00 00:00:00'),
