(55990, 162614, 5240, 3, 'Reunion with Marr', '', '2012-11-14 00:00:00', 2012, 20, 0, 7, '開了個洞\r\n蟲蟲蜂湧而出\r\n恐怖至極\r\n沒完沒了\r\n纖弱不已\r\n我們大夥兒\r\n星期二比較好\r\n因為有空\r\n\r\n這把吉他的音色真棒\r\n實際的工作是顧問\r\n閒暇時喝百威啤酒\r\n一般水準的行為是什麼\r\n\r\n眼睛充滿血絲 被健康食品包圍\r\n用力繫緊安全帶後發紺症狀\r\n\r\nI try to know about you so far.', '', 270, '', '', '', '', '', '', 1, 1, 0, '2012-11-13 16:23:02', '2015-03-12 13:56:50', '0000-00-00 00:00:00'),
(55991, 162614, 5240, 4, 'ウトムヌカラ', '', '2012-11-14 00:00:00', 2012, 20, 0, 7, '昨天理應孵化的夢境\r\n定睛一看只是隨手塗鴉\r\n那一天從這裡出走的兩人\r\n面帶疲憊的坐在地上\r\n如果能去個哪裡都好\r\n\r\n就在不遠處有座旋轉木馬\r\n保持著距離我只是眺望著\r\n你分享給我的\r\n那個充滿陽光的地方\r\n接下來會短暫的變冷\r\n花兒也將凋零為了明天\r\n赤腳的兩人昨天該回去的那個家\r\n已經只是個房間\r\n因此告別了它\r\n\r\n看起來很遙遠的旋轉木馬\r\n就在這裡自由地得到幸福吧\r\n希望能傳達到內心深處\r\n雙手抱滿淺紫色的花走在街上\r\n可以在這裡能夠這樣真是太好了\r\n\r\n希望無論到何時妳的心\r\n都能晴空普照\r\n\r\n無論在哪裡都有的旋轉木馬\r\n讓我們自由地得到幸福吧\r\n請讓我共享妳的每一天\r\n\r\n一切都太美好了\r\n這是個充滿陽光的我倆的家\r\n走在充滿陽光的路上回家\r\n\r\n能夠面帶微笑談著明天的妳\r\n真是太美好了', '', 355, '', '', '', '', '', '', 1, 1, 0, '2012-11-13 16:23:52', '2015-03-12 13:56:50', '0000-00-00 00:00:00'),
(55992, 162589, 5231, 8, 'The Sound Stars Make', '', '2011-11-28 00:00:00', 2000, 20, 0, 1, '', '', 204, '', '', '', '', '', '', 0, 0, 0, '2012-11-13 16:24:06', '2015-03-12 13:56:50', '0000-00-00 00:00:00'),
(55993, 162614, 5240, 5, 'Slogan', '', '2012-11-14 00:00:00', 2012, 20, 0, 7, '昨晚的暴風雨\r\n宛如騙人的般化為假象\r\n從今天起這裡\r\n已經不是個家\r\n已經不是個家了\r\n\r\n不知道從何時開始就這樣\r\n那些傢伙們的今天\r\n因為虛構的罪業而停止思考\r\n微笑吧\r\n是啊 就留下他們吧\r\n前往真實的世界\r\n\r\n謳歌明日的標語\r\n謳歌明日就在今天\r\n\r\n是誰代替人造花\r\n摘了朵新鮮的花\r\n一邊抱怨著\r\n無法活太久\r\n\r\n沒有與生俱來的\r\n罪惡\r\n和懲罰\r\n總之管它那麼多\r\n你今天在幹嘛\r\n我們在外面碰個面吧\r\n有個地方\r\n想帶你去看\r\n\r\n謳歌明日的標語\r\n謳歌明日就在今天', '', 283, '', '', '', '', '', '', 1, 1, 0, '2012-11-13 16:24:56', '2015-03-12 13:56:50', '0000-00-00 00:00:00'),
